import { useState, useEffect } from "react";

const TestApp = () => {
  const [aaa, setstate] = useState(false);

  useEffect(() => {
    console.log("aaa", aaa);
  }, [aaa]);

  const handle = () => {
    setstate(!aaa);
    // console.log(aaa);
  };

  return (
    <div>
      <div onClick={() => handle()}>click</div>
      <p>{aaa}</p>
    </div>
  );
};

export default TestApp;
